import React from "react";
import ReactDOM from "react-dom/client";

function Greeting() {
  return (
    <>
      <div>
        <h1>My first Component</h1>
        <ol>
          <li>
            <a href="#"> Hello world </a>
          </li>
        </ol>
      </div>
      <h2>YOO</h2>
    </>
  );
}

const root = ReactDOM.createRoot(document.getElementById("root"));

root.render(<Greeting />);
